Naudodami „Google“ produktus mobiliesiems ir paslaugas („Paslaugos“), sutinkate laikytis
a) „YouTube“ naudojimosi sąlygų (%1$s/tos_youtube) su „YouTube“ susijusioms paslaugoms;
b) „Google“ žemėlapių taisyklių ir nuostatų (%1$s/tos_maps) su žemėlapiais susijusioms, vietinėmis ir su buvimo vieta susijusioms paslaugoms;
c) „Google“ knygų paslaugų teikimo sąlygų (%1$s/tos_books) su knygomis susijusioms paslaugoms ir
e) „Google“ paslaugų teikimo sąlygų (%1$s/utos) visoms kitoms paslaugoms; šios sąlygos kartais atnaujinamos.
